import React, { useState } from 'react';
import { useUsuario } from '../../context/UsuarioContext';

const Informes = () => {
  const { usuario } = useUsuario();
  const [generating, setGenerating] = useState(false);

  // Función para formatear fecha de forma profesional
  const formatDate = () => {
    const date = new Date();
    const options = { 
      year: 'numeric', 
      month: 'long', 
      day: 'numeric',
      hour: '2-digit',
      minute: '2-digit'
    };
    return date.toLocaleDateString('es-ES', options);
  };

  const handleGeneratePDF = () => {
    if (!window.electronAPI?.generatePDF) {
      console.error('Electron API no disponible');
      alert('La función de PDF no está disponible en este entorno.');
      return;
    }

    setGenerating(true);

    const html = `
      <!DOCTYPE html>
      <html lang="es">
      <head>
        <meta charset="UTF-8" />
        <meta name="viewport" content="width=device-width, initial-scale=1.0" />
        <title>Informe de Usuario - ${usuario.nombre}</title>
        <style>
          /* Estilos formales y profesionales */
          * { 
            margin: 0; 
            padding: 0; 
            box-sizing: border-box; 
          }
          
          body { 
            font-family: 'Georgia', 'Times New Roman', serif;
            line-height: 1.6;
            color: #333;
            background: #ffffff;
            padding: 40px 0;
          }
          
          .document-container {
            max-width: 800px;
            margin: 0 auto;
            background: white;
            padding: 50px;
            border: 1px solid #e0e0e0;
            box-shadow: 0 4px 20px rgba(0, 0, 0, 0.08);
          }
          
          /* Encabezado con logotipo */
          .document-header {
            display: flex;
            justify-content: space-between;
            align-items: flex-start;
            margin-bottom: 40px;
            padding-bottom: 20px;
            border-bottom: 2px solid #1a237e;
          }
          
          .header-info {
            flex: 1;
          }
          
          .document-title {
            color: #1a237e;
            font-size: 28px;
            font-weight: 600;
            margin-bottom: 8px;
            letter-spacing: -0.5px;
          }
          
          .document-subtitle {
            color: #555;
            font-size: 16px;
            font-weight: 400;
          }
          
          .company-logo {
            width: 150px;
            height: auto;
            margin-left: 30px;
          }
          
          /* Sección de metadatos */
          .metadata-section {
            background: #f8f9fa;
            padding: 20px;
            border-radius: 4px;
            margin-bottom: 30px;
            border-left: 4px solid #1a237e;
          }
          
          .metadata-grid {
            display: grid;
            grid-template-columns: repeat(2, 1fr);
            gap: 15px;
          }
          
          .metadata-item {
            font-size: 14px;
          }
          
          .metadata-label {
            color: #666;
            font-weight: 500;
            margin-bottom: 4px;
          }
          
          .metadata-value {
            color: #1a237e;
            font-weight: 600;
          }
          
          /* Tabla de datos */
          .data-section {
            margin-bottom: 40px;
          }
          
          .section-title {
            color: #1a237e;
            font-size: 20px;
            font-weight: 600;
            margin-bottom: 20px;
            padding-bottom: 10px;
            border-bottom: 1px solid #e0e0e0;
          }
          
          .data-table {
            width: 100%;
            border-collapse: collapse;
            font-size: 14px;
          }
          
          .data-table th {
            background: #f8f9fa;
            color: #555;
            font-weight: 600;
            text-align: left;
            padding: 12px 15px;
            border-bottom: 1px solid #e0e0e0;
            text-transform: uppercase;
            font-size: 13px;
            letter-spacing: 0.5px;
          }
          
          .data-table td {
            padding: 12px 15px;
            border-bottom: 1px solid #f0f0f0;
          }
          
          .data-table tr:last-child td {
            border-bottom: none;
          }
          
          .avatar-cell {
            text-align: center;
          }
          
          .avatar-preview {
            width: 70px;
            height: 70px;
            border-radius: 50%;
            object-fit: cover;
            border: 2px solid #1a237e;
            margin: 0 auto;
            display: block;
          }
          
          /* Resumen de configuración */
          .config-summary {
            background: #f3f4f6;
            padding: 25px;
            border-radius: 6px;
            margin-top: 30px;
          }
          
          .config-grid {
            display: grid;
            grid-template-columns: repeat(auto-fit, minmax(200px, 1fr));
            gap: 20px;
          }
          
          .config-item {
            background: white;
            padding: 15px;
            border-radius: 4px;
            border: 1px solid #e0e0e0;
          }
          
          .config-label {
            color: #666;
            font-size: 13px;
            margin-bottom: 5px;
          }
          
          .config-value {
            color: #1a237e;
            font-weight: 600;
            font-size: 15px;
          }
          
          /* Pie de página */
          .document-footer {
            margin-top: 50px;
            padding-top: 20px;
            border-top: 1px solid #e0e0e0;
            font-size: 12px;
            color: #777;
            text-align: center;
          }
          
          .footer-grid {
            display: grid;
            grid-template-columns: repeat(3, 1fr);
            gap: 20px;
            margin-bottom: 15px;
          }
          
          .footer-item {
            font-size: 11px;
            color: #888;
          }
          
          .footer-note {
            font-style: italic;
            margin-top: 10px;
            color: #999;
          }
          
          /* Estado */
          .status-badge {
            display: inline-block;
            padding: 4px 12px;
            border-radius: 12px;
            font-size: 12px;
            font-weight: 600;
            text-transform: uppercase;
            letter-spacing: 0.5px;
          }
          
          .status-active {
            background: #e8f5e9;
            color: #2e7d32;
          }
          
          .status-inactive {
            background: #ffebee;
            color: #c62828;
          }
        </style>
      </head>
      <body>
        <div class="document-container">
          <!-- Encabezado -->
          <div class="document-header">
            <div class="header-info">
              <h1 class="document-title">Informe de Perfil de Usuario</h1>
              <p class="document-subtitle">Documento confidencial - Uso interno</p>
            </div>
            <div class="logo-container">
              <!-- Aquí puedes cambiar la ruta de la imagen por la de tu logo -->
              <img src="data:image/png;base64," 
                   alt="Logotipo Empresa" 
                   class="company-logo" />
            </div>
          </div>
          
          <!-- Metadatos del informe -->
          <div class="metadata-section">
            <div class="metadata-grid">
              <div class="metadata-item">
                <div class="metadata-label">Número de Informe</div>
                <div class="metadata-value">USR-${Date.now().toString().slice(-6)}</div>
              </div>
              <div class="metadata-item">
                <div class="metadata-label">Fecha de Generación</div>
                <div class="metadata-value">${formatDate()}</div>
              </div>
              <div class="metadata-item">
                <div class="metadata-label">Generado por</div>
                <div class="metadata-value">Sistema de Gestión</div>
              </div>
              <div class="metadata-item">
                <div class="metadata-label">Estado del Informe</div>
                <div class="metadata-value">Final</div>
              </div>
            </div>
          </div>
          
          <!-- Sección 1: Datos Personales -->
          <div class="data-section">
            <h2 class="section-title">Información Personal</h2>
            <table class="data-table">
              <thead>
                <tr>
                  <th>Campo</th>
                  <th>Valor</th>
                  <th>Observaciones</th>
                </tr>
              </thead>
              <tbody>
                <tr>
                  <td><strong>Nombre Completo</strong></td>
                  <td>${usuario.nombre || 'No especificado'}</td>
                  <td>Usuario del sistema</td>
                </tr>
                <tr>
                  <td><strong>Correo Electrónico</strong></td>
                  <td>${usuario.email || 'No especificado'}</td>
                  <td>Dirección de contacto principal</td>
                </tr>
                <tr>
                  <td><strong>Avatar/Imagen</strong></td>
                  <td class="avatar-cell">
                    ${usuario.avatar ? `
                      <img src="${usuario.avatar}" class="avatar-preview" alt="Foto de perfil" />
                    ` : 'No establecido'}
                  </td>
                  <td>Imagen de perfil del usuario</td>
                </tr>
              </tbody>
            </table>
          </div>
          
          <!-- Sección 2: Preferencias de Sistema -->
          <div class="data-section">
            <h2 class="section-title">Configuración del Sistema</h2>
            <table class="data-table">
              <thead>
                <tr>
                  <th>Parámetro</th>
                  <th>Configuración Actual</th>
                  <th>Estado</th>
                </tr>
              </thead>
              <tbody>
                <tr>
                  <td><strong>Idioma Preferido</strong></td>
                  <td>${usuario.idioma || 'No especificado'}</td>
                  <td>
                    <span class="status-badge ${usuario.idioma ? 'status-active' : 'status-inactive'}">
                      ${usuario.idioma ? 'Configurado' : 'Por defecto'}
                    </span>
                  </td>
                </tr>
                <tr>
                  <td><strong>Sistema de Autoguardado</strong></td>
                  <td>${usuario.autoGuardado ? 'Activado' : 'Desactivado'}</td>
                  <td>
                    <span class="status-badge ${usuario.autoGuardado ? 'status-active' : 'status-inactive'}">
                      ${usuario.autoGuardado ? 'Activo' : 'Inactivo'}
                    </span>
                  </td>
                </tr>
              </tbody>
            </table>
          </div>
          
          <!-- Resumen de Configuración -->
          <div class="config-summary">
            <h3 style="color: #1a237e; margin-bottom: 20px; font-size: 16px;">Resumen de Configuración</h3>
            <div class="config-grid">
              <div class="config-item">
                <div class="config-label">Perfil Completado</div>
                <div class="config-value">${usuario.nombre && usuario.email ? '85%' : '40%'}</div>
              </div>
              <div class="config-item">
                <div class="config-label">Configuraciones Activas</div>
                <div class="config-value">${(usuario.idioma ? 1 : 0) + (usuario.autoGuardado ? 1 : 0)} de 2</div>
              </div>
              <div class="config-item">
                <div class="config-label">Última Actualización</div>
                <div class="config-value">Hoy</div>
              </div>
            </div>
          </div>
          
          <!-- Pie de Página -->
          <div class="document-footer">
            <div class="footer-grid">
              <div class="footer-item">
                <strong>Documento:</strong> Informe de Usuario<br>
                <strong>Versión:</strong> 1.0
              </div>
              <div class="footer-item">
                <strong>Confidencialidad:</strong> Alta<br>
                <strong>Propósito:</strong> Interno
              </div>
              <div class="footer-item">
                <strong>Página:</strong> 1 de 1<br>
                <strong>Formato:</strong> PDF
              </div>
            </div>
            <p class="footer-note">
              Este documento ha sido generado automáticamente por el Sistema de Gestión. 
              Cualquier modificación debe ser aprobada por el departamento correspondiente.
            </p>
            <p style="margin-top: 10px; font-size: 10px; color: #aaa;">
              &copy; ${new Date().getFullYear()} Tu Empresa S.L. - Todos los derechos reservados.
            </p>
          </div>
        </div>
      </body>
      </html>
    `;

    try {
      window.electronAPI.generatePDF(html);
      
    } catch (error) {
      console.error('Error al generar PDF:', error);
      alert('Error al generar el PDF');
      setGenerating(false);
    }
  };

  return (
    <button
      style={{
        padding: "10px 20px",
        background: generating ? "#ccc" : "var(--color-primary)",
        color: "white",
        border: "none",
        borderRadius: "8px",
        fontSize: "0.9rem",
        fontWeight: 600,
        cursor: generating ? "not-allowed" : "pointer",
        transition: "all 0.3s ease",
        minWidth: "160px",
        display: "flex",
        alignItems: "center",
        justifyContent: "center",
        gap: "8px"
      }}
      onClick={handleGeneratePDF}
      disabled={generating}
      onMouseOver={(e) => {
        if (!generating) e.currentTarget.style.opacity = "0.9";
      }}
      onMouseOut={(e) => {
        if (!generating) e.currentTarget.style.opacity = "1";
      }}
    >
      {generating ? (
        <>
          <span>Generando...</span>
          <div className="spinner" style={{
            width: '16px',
            height: '16px',
            border: '2px solid rgba(255,255,255,0.3)',
            borderTop: '2px solid white',
            borderRadius: '50%',
            animation: 'spin 1s linear infinite'
          }} />
          <style>{`
            @keyframes spin {
              0% { transform: rotate(0deg); }
              100% { transform: rotate(360deg); }
            }
          `}</style>
        </>
      ) : (
        'Generar informe PDF'
      )}
    </button>
  );
};

export default Informes;